var calc_output = [];

var age = parseFloat(age);
var arrest = parseFloat(arrest);
var history = parseFloat(history);
var hypertension = parseFloat(hypertension);

if (UOMSYSTEM == true) { //US units
    var weight = parseFloat(weight) * 0.453592;
    var height = parseFloat(height) * 2.54;
} 
if (UOMSYSTEM == false) { //SI units
    var weight = parseFloat(weight);
    var height = parseFloat(height);
}

var delivery;
var vbac;

if (history == 0) {
    delivery = 0;
    vbac = 0
} else if (history == 1) {
    delivery = 1;
    vbac = 0;
} else if (history == 2) {
    delivery = 0;
    vbac = 1;
}

var w = -5.952 - 0.023*age - 0.024*weight + 0.056*height - 0.597*arrest + 0.868*delivery + 1.869*vbac - 0.966*hypertension;

var prob = Math.exp(w)/(1 + Math.exp(w)) * 100;

calc_output.push({
    name: 'mini',
    value: prob.toFixed(1),
    value_text: '%',
    message: 'Chance of successful vaginal birth after cesarean delivery'
});
calc_output.push({
    name: 'VBAC',
    value: prob.toFixed(1),
    value_text: '%',
    message: 'Chance of successful vaginal birth after cesarean delivery'
});
